import React, { Component } from 'react'
import './login.css'
import logo from './images/LOGO.png'  //引入图片方式不能用原生src方式
import { Form, Icon, Input, Button, Checkbox } from 'antd'; //引入antd表单组件

export default class Login extends Component {
    render() {
        return (
            <div className="login">
                <header className="login-header">
                    <img src={logo} alt="" />
                    <h1>矢易科技后台管理系统</h1>
                </header>
                <section className="login-content">
                    <h2>用户登陆</h2>
                    <div>antd-Form组件标签</div>
                </section>
            </div>
        )
    }
}
